$_MODULE['<{ets_affiliatemarketing}prestashop>defines_f02a6e55d695602047213e1612089f9d'] = 'Etiquetas de datos disponibles: [highlight][total_past_order][end_highlight], [highlight][min_order_total][end_highlight], [highlight][amount_left][end_highlight].  Deja este campo en blanco para ocultar la pestaña \"Programa de fidelización\" desde la página \"Mi cuenta\" cuando el mínimo total de pedido no llegue al importe requerido.';
