$_MODULE['<{ets_affiliatemarketing}prestashop>defines_9099dae88a59c0caab4ec694ba4def0f'] = 'Esta opción garantiza que solo los clientes que estén realmente interesados en el programa de referencia / patrocinio, sean patrocinadores de su sitio web. Tú (administrador) deberás aprobar manualmente las solicitudes para permitir que el cliente se una al programa de refidos / patrocinio';
