$_MODULE['<{ets_affiliatemarketing}prestashop>defines_f9f729f415aa9e3c148144043fee8bf1'] = 'Calculado por el coste total de todos los pedidos anteriores. Esto es para asegurarte que solo se permita que los clientes de calidad se conviertan en patrocinadores. Deja el campo en blanco para permitir que todos los clientes de los grupos seleccionados se conviertan en patrocinadores';
