$_MODULE['<{ets_affiliatemarketing}prestashop>defines_e41c3d27e5f00685e5c8d592d762ee12'] = 'Esto permite que los patrocinadores puedan ganar recompensas cuando sus amigos patrocinados compren productos. Soporta de m Marketing Multinivel (los patrocinadores también pueden ganar recompensas cuando los clientes de todos los niveles inferiores compran productos)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_a07a007d26416180aaa9bb8dd4e50a46'] = 'Solo dar recompensa en pedidos de';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_b0e8be6a37f1a40900b3efc60f19f23a'] = 'primeros nuevos amigos';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_d015964931b30fb9ab1699941561f531'] = 'Esto es para limitar el número de pedidos de los que los patrocinadores obtendrán una recompensa limitando el número de amigos patrocinados directos de los cuales puedan obtener recompensas en sus pedidos. Cuando un cliente realiza un pedido que está fuera de este límite, todos los patrocinadores (cualquier nivel) no recibirán recompensa alguna. Deja este campo en blanco si desea dar una recompensa a los patrocinadores cuando alguno de los amigos que ellos patrocinaron compre productos en su tienda';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_ba1053f5c3549e600c5213852b6ef6c0'] = 'Tan solo dar recompensa por';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_a65fa179670e172d23e38f0926078b5e'] = 'primeros pedidos de cada amigo';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_84aebb7d0db493ae8150eb880aa48f36'] = 'Esto es para limitar el número de pedidos de los cuales los patrocinadores obtendrán una recompensa limitando el número de pedidos para otorgarles una recompensa (todos los niveles) de cada amigo. Deja este campo en blanco si quieres dar una recompensa al patrocinador en todos los pedidos de sus amigos';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_9d1cdef34c895721ee018d787ebe77e2'] = 'Es necesario un pedido total mínimo del amigo del patrocinador para obtener la recompensa';
