$_MODULE['<{ets_affiliatemarketing}prestashop>defines_19ba7d945f7bf95867cde5e6ece03c60'] = 'Este es el total máximo de dinero que desea pagar por el sistema de patrocinio cuando se genera un pedido, calculado por porcentaje basado en el costo total del pedido. Esto es para asegurarse de que no pagará tanto costo de marketing cuando el sistema de patrocinio genere un pedido. ¿Cuánto en total le gustaría pagar a los patrocinadores por cada pedido de sus amigos? Si deja este campo en blanco, dejará de dar recompensas a todos los patrocinadores cuando se genere un nuevo pedido.';
