$_MODULE['<{ets_affiliatemarketing}prestashop>defines_6596779bff505778beeb0c79832395d9'] = 'Deja este campo en blanco si no quieres dar recompensa por los niveles inferiores. Dejar este campo en blanco ayudará a limitar la profundidad del árbol de marketing multinivel al no otorgar recompensas a todos los niveles de patrocinador';
