$_MODULE['<{ets_affiliatemarketing}prestashop>defines_1b3e34dea2a630215ffd3e14efce91db'] = 'Habilite esta opción si desea otorgar el resto del dinero desde \"Costo del patrocinador\" (si lo tiene después de calcular la recompensa para todos los niveles de patrocinador definidos anteriormente) al \"Nivel 1\" (patrocinador directo). De lo contrario, el resto del dinero no se le dará a ningún patrocinador, ¡solo guárdelo para usted!';
